import React from 'react'
import Options from './options'
import styled from 'styled-components'

const Container = styled.div`
  &:nth-child() {
    margin-bottom: 20px;
  }
`

const Tests = () => {
  return (
    <Container>
      <Options />
      <Options />
      <Options />
    </Container>
  )
}

export default Tests
